INSERT INTO `settings` (`id`, `skey`, `value`) VALUES
(31, 'aml_text', '\n\n\n\n<p>1The purposes of the {SERVER_NAME}’s Anti-Money Laundering, Counter-Terrorist Financing and Know Your Customer Policy (hereinafter — the “<strong>AML/KYC Policy</strong>“) is to identify, prevent and mitigate possible risks of {SERVER_NAME} being involved in illegal activity.</p><p>To confirm with international and local regulations, {SERVER_NAME} has implemented effective internal procedures to prevent money laundering, terrorist financing, drug and human trafficking, proliferation of weapons of mass destruction, corruption and bribery and to react correspondingly in case of any form of suspicious activity from its Users.</p><p><strong>Money Laundering</strong>&nbsp;can be defined as: ‘the conversion or transfer of property, knowing that such property is derived from criminal activity, or from an act of participation in such activity, for the purposes of concealing or disguising the illicit origin of the property, or assisting any person who is involved in the commission of such activity to evade the legal consequences of his action.’</p><p><strong>Terrorist Financing</strong>&nbsp;can be defined as: ‘the wilful provision or collection, by any means, directly or indirectly, of funds with the intention that the funds should be used, or in the knowledge that they are to be used, in order to carry out terrorist acts.’</p><p>All firms must adhere to the Money Laundering, Terrorist Financing and Transfer of Funds (Information on the Payer) Regulations 2017 (MLRs), and be aware of the guidance set down by the Joint Money Laundering Steering Group (JMLSG) which provides guidelines within the United Kingdom on how firms should conduct Due Diligence on their customers, and the recommendations from the Financial Action Task Force (FATF), an inter-governmental body whose purpose is the development and promotion of national and international policies to combat money laundering and terrorist financing.</p><p><b>Other legislation in relation to AML/KYC are:</b></p><i><ul><li>5th Anti-Money Laundering Directive ((EU) 2018/843)</li><li>The Proceeds of Crime Act 2002;</li><li>Terrorism Act 2000 and 2001;</li><li>Counter-Terrorism Act 2008;</li><li>HM Treasury Sanction Notices;</li><li>FCA Handbook.</li></ul><p>AML/KYC Policy includes:</p><ul><li>Verification procedure;</li><li>Role of the Chief Compliance Officer;</li><li>Transactions Monitoring;</li><li>Risk Assessment:</li><li>Country of Residence.</li></ul></i><p>&nbsp;</p><p><strong>Verification procedures</strong></p><p>To help fight the funding of terrorism and money laundering activities, the Law requires all financial institutions to obtain, verify and record information that identifies each person or entity who opens an Account. We are required by Law to ask you to provide your name, address, date of birth and other information about you, your organisation or persons related to your organisation that will allow us to identify you before we approve your Account. We also may ask you to provide certain identifying documents, such as your driver’s license or passport or your organisation’s articles of incorporation and may obtain credit and other consumer reports to assist us in verifying your identity and in determining whether you satisfy our account criteria. Unless you provide the requested information and documentation, we may not be able to open your Account.</p><p>By applying for an {SERVER_NAME} Account, you agree to provide the information and documentation requested by {SERVER_NAME} and consent to {SERVER_NAME}’s acquisition of credit and other consumer reports about you for the purposes described above.</p><p>The {SERVER_NAME}’s Customer due diligence (“<strong>CDD</strong>“) procedure requires the Users to provide {SERVER_NAME} with reliable, independent source documents to identify them and confirm their residential address. Such documents may include, for example, a national ID card, an international passport, a bank statement, a utility bill. For such purposes, {SERVER_NAME} reserves the right to collect the Users’ identification information for the purposes of compliance with its AML/CFT and KYC Policy.</p><p>{SERVER_NAME} will take steps to confirm the authenticity of documents and information provided by Users. {SERVER_NAME} will also look to verify identification information through secondary sources, and {SERVER_NAME} reserves the right to investigate further the cases of Users where {SERVER_NAME} is not satisfied with the documentation submitted.</p><p>{SERVER_NAME} reserves the right to verify the identity of the User on an ongoing basis, especially when its identification information has been changed or its activities appear suspicious (unusual for a particular User). In addition, {SERVER_NAME} reserves the right to request from the Users current documents, even if they have been authenticated in the past.</p><p>Information about the user’s identification will be collected, stored, shared and protected strictly in accordance with the {SERVER_NAME}’s&nbsp;Privacy Policy&nbsp;and relevant rules. The User agrees that if any information provided in the Account application changes, ceases to be true or becomes materially misleading (including, but not limited to, the ownership of the Account) then the User will notify {SERVER_NAME} of the changes.</p><p>After confirming the identity of the user, {SERVER_NAME} may refuse to provide Services to the User if {SERVER_NAME}’s Services are suspected to be used for the purposes of conducting illegal activities.</p><p>{SERVER_NAME} has a regulatory requirement to verify the sources of Fiat Money and/or Cryptocurrency to know that the sources of the Funds that Users use to trade with are legitimate. {SERVER_NAME} will require evidence of the source of Funds; this may include bank statements for Fiat Money or a video showing wallet transaction details for Cryptocurrency.</p><p>Users who intend to use payment cards for the purpose of consuming Services must undergo a card check in accordance with the instructions available on the {SERVER_NAME}’s Site.</p><p>{SERVER_NAME} uses independent third-party companies for the following:</p><ul><li>check Users against Politically Exposed Person’s (PEP) and Sanctions Lists as well as checks for Adverse Media.</li><li>assess User’s cryptocurrency wallets with regards to AML investigation and compliance.</li></ul><p>{SERVER_NAME} reserves the right to terminate or refuse Accounts on the basis of information attained by the third-party companies this includes Users connected to “high-risk” wallets.</p><p><strong>Chief Compliance Officer</strong></p><p>The Chief Compliance Officer is the person, duly authorised by {SERVER_NAME}, whose duty is to ensure the effective implementation and enforcement of the AML/CFT and KYC Policy. It is the Chief Compliance Officer’s responsibility to supervise all aspects of {SERVER_NAME}’s anti-money laundering and counter-terrorist financing procedures, in particular:</p><ul><li>collection of Users’ identification information;</li><li>establishing and updating internal policies and procedures for the completion, review, submission and retention of all reports and records required under the applicable laws and regulations;</li><li>monitoring transactions and investigating any significant deviations from normal activity;</li><li>implementing a records management system for appropriate storage and retrieval of documents, files, forms and logs, updating risk assessment regularly, providing law enforcement with information as required under the applicable laws and regulations.</li></ul><p>The Chief Compliance Officer is the contact point for {SERVER_NAME} with law enforcement agencies for the purposes of prevention of money laundering, terrorist financing and other illegal activities.</p><p><strong>Transaction Monitoring</strong></p><p>{SERVER_NAME} Users must complete the {SERVER_NAME}’s identity verification process (who you are) before trading. After verification is completed the User consents to transaction Monitoring, {SERVER_NAME} analyses User’s transactional patterns (what they do).</p><p>{SERVER_NAME} relies on data analysis as a risk-assessment and suspicious activity detection tools. These tools perform a variety of compliance-related tasks, including capturing data, filtering, record-keeping, investigation management and reporting.</p><p>In connection with the AML/KYC Policy, {SERVER_NAME} will:</p><ul><li>monitor all transactions. {SERVER_NAME} reserves the right to ensure that transactions of suspicious nature are reported to the proper law enforcement;</li><li>request the User to provide any additional information and documents in case of suspicious transactions;</li><li>suspend or terminate User’s Account when {SERVER_NAME} has a reasonable suspicion that such User is engaged in illegal activity.</li></ul><p>However, the above list is not exhaustive and the Chief Compliance Officer will monitor Users’ transactions on a regular basis in order to define whether such transactions are to be reported and treated as suspicious.</p><p><strong>Risk Assessment</strong></p><p>In order to meet its obligations regarding Anti-Money Laundering (AML) and Counter Terrorist Financing (CTF) {SERVER_NAME} completes an annual AML Risk Assessment. The aim of the AML Risk Assessment is to prevent criminals using {SERVER_NAME} to launder money by highlighting risks and assessing controls {SERVER_NAME} has put in place. A risk-based approach is taken to identify Users and monitor how they use our Services.</p><p>The Chief Compliance Officer is responsible for managing financial crime risks and making improvements in financial crime risk management through identifying the general and specific money laundering risks that {SERVER_NAME} is facing, determining how these risks are mitigated by the {SERVER_NAME}’s AML controls and establishing the residual risk that remains for {SERVER_NAME}.</p><p><strong>Country of Residence</strong></p><p>{SERVER_NAME}’s AML and KYC Policy sets out {SERVER_NAME}’s risk appetite with regard to AML/KYC. To reduce this risk {SERVER_NAME} does not accept clients who are resident in countries deemed to be above the {SERVER_NAME}’s risk appetite.</p><p>The sources used with regards to the categorisation were:</p><ul><li>Transparency International;</li><li>Know Your Country;</li><li>FATF High Risk Jurisdictions;</li><li>EU High Risk Jurisdictions;</li><li>Countries where Digital Assets are prohibited or there are restrictions on trading;</li><li>Countries where Digital Assets are not prohibited;</li><li>Countries subject to UNSC Sanctions Regime.</li></ul><p>It must me clear that {SERVER_NAME}’s policy is that&nbsp;<strong>all</strong>&nbsp;clients resident in the below countries are banned and cannot be accepted as a client. Any clients that try to open an account will be denied and any funds returned to source.</p><p><strong>Full list of Banned Jurisdictions</strong></p><div class=\"custom-scroll\"><table><tbody><tr><td><ul><li>Afghanistan</li><li>Albania</li><li>Angola</li><li>Algeria</li><li>Bangladesh</li><li>Barbados</li><li>Bolivia</li><li>Botswana</li><li>Burma (Myanmar)</li><li>Burundi</li><li>Cambodia</li><li>Central African Republic</li><li>Chad</li><li>Congo</li><li>Guinea – Conakry</li><li>Cote D’ivoire</li><li>Crimea (Ukraine region)</li><li>Cuba</li><li>Democratic People’s Republic of Korea (DPRK)</li><li>Ecuador</li><li>Egypt</li><li>Equatorial Guinea</li><li>Eritrea</li><li>Ghana</li><li>Guinea Bissau</li><li>Guyana</li><li>Haiti</li><li>Iran</li><li>Iraq</li><li>Jamaica</li></ul></td><td><ul><li>Lao PDR</li><li>Lebanon</li><li>Libya</li><li>Mali</li><li>Morocco</li><li>Myanmar</li><li>Nepal</li><li>Nicaragua</li><li>North Macedonia</li><li>Pakistan</li><li>Panama</li><li>Qatar</li><li>Saudi Arabia</li><li>Somalia</li><li>South Sudan</li><li>Sudan</li><li>Syria</li><li>Tunisia</li><li>Uganda</li><li>Vanuatu</li><li>Venezuela</li><li>Yemen</li><li>Zimbabwe</li></ul></td></tr></tbody></table></div><p>{SERVER_NAME} also does not accept any clients from disputed territories as they do not produce recognised official documents, these include:</p><table><tbody><tr><td><ul><li>Donetsk People’s Republic (DPR)/Luhansk People’s Republic (LPR)</li><li>Pridnestrovian Moldavian Republic</li><li>Nagorno-Karabakh Republic</li><li>Republic of Abkhazia</li><li>Republic of Somaliland</li><li>Republic of South Ossetia</li><li>Turkish Republic of Northern Cyprus</li></ul></td><td><ul><li>Republic of China (Taiwan)</li><li>Passports issued by the Russian Federation in Crimea and passports issued to residents of Donetsk and Luhansk regions of Ukraine do not qualify for verification</li><li>Republic of Kosovo</li><li>Sahrawi Arab Democratic Republic</li><li>Republic of Artsakh</li></ul></td></tr></tbody></table>\n\n\n\n\n\n\n\n\n\n\n\n'),
